import React from 'react';

const Player = (props) => {
  const { img, name } = props;

  return (
    <div className="player">
      <div>
        <img src={img} alt="avatar" />
      </div>
      <div>
        <p>{name}</p>
      </div>
    </div>
  );
};

export default Player;
